import React from 'react';

//imagenes
import logo from './img/x.png';


class Page404 extends React.Component {
  render() {
    return (
    	<div className="page">
    		<img src={logo} alt="" width="90px" height="90px" />
    		<h1>Page 404</h1>
    		Esta pagina que estas buscando no existe.
    	</div>
    );
  }
}
export default Page404;
